    summary:
      '<p>Styles may change, but murder lasts forever. <b>A Crime to Remember</b> invites viewers to step into the past and unravel the intricacies of real-life murder cases of the ‘50s and ‘60s. Set against the backdrop of Studebakers, fedoras, and three-martini lunches, these stories of truly mad men and women reveal complicated relationships where thwarted dreams and repressed passions led to terrible crimes. With A Crime to Remember, ID inaugurates a new high-end cinematic style, using the visual grammar of movies to bring the era to life. To properly illustrate each time period, the series stays true to the fashion and styles while highlighting the cultural taboos and social norms that informed each case. Each story is driven by the narrative of a fictional bystander who "knew" the victim, while reporters who covered the case explain how the crime and investigation impacted society.</p>',
