    summary:
      "<p>Set against the backdrop of the high-pressure world of advertising, <b>Trust Me</b> focuses on Mason and Conner, a pair of ad men whose strong creative partnership has served the firm of Rothman Greene &amp; Mohr extremely well over the years. Mason is an art director and a responsible, workaholic family man with a beautiful wife Erin, two children and an undying loyalty to the brands he helps sell. By contrast, his writing partner Conner is a single, impulsive copywriter with the attention span of a teenager. Their yin-yang relationship is put to the test when Mason is named a creative director of the agency, making him Conner's boss. The series follows the changing dynamics between the two friends, who are better together than they are apart. Also working in the same creative group is new hire Sarah Krajicek-Hunter, an award-winning copywriter whose forceful personality has a tendency to rub people the wrong way. Hector and Tom are a junior creative team with nontraditional ideas that don't always sit well with their new boss. The entire team is supervised by Tony Mink, a man who lives and dies by the advertising business but has a growing sense his days in this young person's business may be numbered. Trust Me follows these memorable characters as they try to navigate the waters of inter-office politics, personality conflicts, easily bruised egos, professional jealousies and unreasonable client demands.</p>",
