    summary:
      '<p><b>Twenty Twelve</b> follows the team responsible for delivering the biggest show on earth: the London Olympics. The actors and creators of some of Britain\'s most iconic comedies come together in this new documentary-style comedy that is not only deliciously topical and wickedly funny but also uncannily close to real life.</p><p>Starring Hugh Bonneville ("Downton Abbey"), Jessica Hynes ("Spaced"), Olivia Colman ("Peep Show"), Amelia Bullmore ("I\'m Alan Partridge"), Vincent Franklin, and Karl Theobald ("Green Wing") and narrated by David Tennant this comedy series takes a close look at the people paddling hard beneath the water to make the Olympics happen in London 2012.</p><p>They have billions of pounds to spend and plenty of time before the deadline; so what can possibly go wrong? Well, what do you do when the much-vaunted wind turbines won\'t turn because there\'s no wind? And how do you cope with athletes who want to help but are just too dull? It\'s all in a day\'s work for the men and women whose job it is to stage the greatest sporting event in the world.</p>',
