      "<p>Never before have faceless online critics had so much power over the success or failure of restaurants. A chef can be on their game 99% of the time, but one mistake with one disgruntled customer, and they're facing an uphill battle to get diners back through the doors. In <b>Say It to My Face!</b>, restaurants and critics meet face-to-face, for the first time, to air grievances. With the mentorship of chef co-hosts, Andrew Gruel and Anthony Dispensa, each owner and chef will make-over their restaurant. From the menu, to the décor and staffing – they will look to elevate their business in hopes that their toughest online critics will change their reviews, while helping to encourage new customers to come through the door.</p><p>With over 18 years in the culinary business, Andrew is the CEO and Founder of Slapfish Restaurant Group, and Anthony is the West Coast Director of Operations for the restaurant group. A proponent in the power of social media when it comes to food and dining, Andrew personally responds to negative online reviews for his own restaurant business. From first-hand experience, Andrew and Anthony will help owners and chefs learn that listening to customer's criticism, while having an open mind, will prove to be beneficial in salvaging a restaurant's reputation before it's too late.</p>",
