      "<p><b>In Their Own Words</b> is a unique and stylish new biography series that explores an elite few of the 20th century's greatest figures. The inaugural season features episodes on a diverse trio of extraordinary subjects: three-time World Heavyweight Champion boxer Muhammad Ali, Muppets creator Jim Henson and Britain's long-reigning monarch Queen Elizabeth II.</p><p>Each chapter in these artfully crafted biographies is inspired and marked by some of the most memorable words spoken by these world icons: words that describe the subject creatively and intimately. These memorable quotes keynote the storytelling, as each sequence sheds new light on key moments in our subjects' lives — illuminating their fascinating personalities and spotlighting their profound cultural and historical impact for a new generation of television viewers. Stylized, evocative recreations of significant moments in the subjects' lives add texture to the visual storytelling and also serve as background for some of the featured quotes.</p><p>This non-linear approach to the top of each episode alerts veiwers to the fact that <i>In Their Own Words</i> is a biography series unlike anything they've seen. The majority of the narrative is carried by deeply personal interviews with those who know the subjects intimately: family, co-workers, colleagues, biographers, etc.</p>",
