    summary:
      "<p><b>Tyler Perry's For Better or Worse</b> is a not-so-subtle situation comedy that follows the zany and sometimes tumultuous relationship of a lovesick married couple, Marcus and Angela Williams. Marcus and Angela were first introduced to the world in Tyler's hit feature films <i>Why Did I Get Married</i> and <i>Why Did I Get Married Too</i>. Tasha Smith and Michael Jai White are back to reprise their roles in the half-hour show. Michael plays Marcus, a football player–turned–sports commentator who owns his own sports talk show. Tasha Smith also resumes her role as Angela, the edgy and outspoken wife of Marcus, who is dedicated to her husband, children and marriage. The show follows the lives of Marcus' and Angela's friends as well. There's Joseph, Marcus' best friend and business partner. Joseph is left devastated by his breakup with his longtime girlfriend, Leslie. Tired of waiting for a proposal from Joseph, Leslie has moved on to bigger and better things while staying focused on her career and her undying friendship with Angela. Keisha, Marcus' ex,continues to cause a world of trouble for the group of friends and colleagues. And, Jennifer and Todd are still as crazy as ever.<br /><br /><i>For Better or Worse</i> is groundbreaking television and one of the biggest TV shows movie mogul Tyler Perry has ever produced. The sets, high fashion and the strikingly good-looking cast come together to create a truly sexy and provocative half hour of television. Viewers will experience a fresh approach to the traditional sitcom format that will provide all the elements of well-crafted storytelling and the raw intrigue of reality TV. <i>For Better or Worse</i> explores the controversial and joyous moments associated with marriage and dating in a 21st-century world. And like always, viewers will leave with life-changing messages that have become a trademark of Tyler's brand of entertainment.</p>",
