    summary:
      "<p>For the modern dater, online profiles have become just as important as what you see in person. While swiping through hundreds of pages to find the perfect match, some have mastered the art of the selfie and the perfectly-written caption, but others are making bad choices that hurt their chances at finding love. Enter former <i>What Not to Wear</i> host and style expert, Clinton Kelly and online dating guru, Devyn Simone who help these women become their best self, inside and out <i>and</i> online in <b>Love at First Swipe</b>. The series is about identifying the mistakes people make online and then transforming their style and profiles. From oversexed photos to depressing status updates, these online dating profile disasters just aren't clicking.</p><p>In each episode, Clinton and Devyn unearth the rationale behind the photo and status update choices for each unlucky, online dater and then help them transform their look and online presence. Clinton takes each woman for a style makeover that better represents her whole personality - whether it is a mom looking to dress more conservatively or an introvert looking to express herself better through a new wardrobe. After these physical transformations, Devyn gives the women an online dating tutorial complete with new photos and an updated profile. The women then put their new look to the test when Clinton and Devyn share the new and improved profile with 100 potential mates, and then the women choose a date from one of the men that liked her profile. From online disaster to dating in style, these women leave with new-found confidence to conquer the online dating world.</p>",
