      "<p>LMN presents <b>They Took Our Child: We Got Her Back</b>, a new original series that reveals the stories of abducted children who escaped from the hands of their kidnappers; and the families who never gave up hope on getting them home safely. Every day in America, over 1200 children are reported missing. Most are taken by a family member but for those few taken by strangers, if they are not found within the first 24 hours, the odds of them returning back alive are daunting. In the new LMN series, <i>They Took Our Child: We Got Her Back</i>, stories of children who were kidnapped by strangers, and who beat the odds and returned safely home are told.</p><p>Each episode features a single story, told by the formerly kidnapped child and the family members and investigators who tirelessly searched for them. Viewers will hear about the parents' frantic and relentless search for their child, and how they worked with law enforcement to bring them home. Through first-hand accounts, archival materials and true-to-life recreations, viewers will learn how the child was safely returned and how the perpetrator was captured. Episodes culminate with an emotional present day reunion between the adult child and the key person who helped save them from their kidnapper.</p>",
